import routes from '@/router'
import { Routes, Route } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Routes>
        {
          routes.map(route => (<Route path={route.url} element={<route.component/>} key={route.url}/>))
        }
      </Routes>
    </div>
  )
}

export default App;
